import { useEffect, useState } from "react";
import axios from "axios";



function WeatherApp(){

    // let api_key = "5a0d91aa2eb889bc8ed1ce44f7aac4c2";
    const[city,setCity] = useState('')
    const [weatherData, setWeatherData] = useState(null)
    const [unit,setUnit] = useState("metric")
    const [forecastData, setForecastData] = useState(null)

    // const API_KEY = "5a0d91aa2eb889bc8ed1ce44f7aac4c2"
    useEffect(() => { 
        
            if(city)
            {               
                axios
                .get(
                    `https://api.openweathermap.org/data/2.5/weather?q=${city}&appid=5a0d91aa2eb889bc8ed1ce44f7aac4c2`
                )
                
                .then((response) => {
                    setWeatherData(response.data)
                    }) 
                    
                .catch((error) => {
                    console.error('Error fetching', error)
                });
                
                axios
                .get(
                    `https://api.openweathermap.org/data/2.5/forecast?q=${city}&appid=5a0d91aa2eb889bc8ed1ce44f7aac4c2`
                )
                
                .then((response) => {
                    setForecastData(response.data.list)
                    }) 
                    
                .catch((error) => {
                    console.error('Error fetching', error)
                });
             }
    },[city,unit]);
   

    // const handleCityChange =(e) =>{
    //     setCity(e.target.value)
        console.log(weatherData)
        console.log(forecastData)
        console.log(city)
    // }

    function handleUnitToggle(){
        setUnit((prevUnit) => (prevUnit === 'metric' ? 'imperial' : "metric"));
    }


    return(
        <>
        <div className="inputdata">
        <input type ="text" value={city}  onChange={(e) => setCity(e.target.value)}/>
        
        <button onClick={handleUnitToggle}>
            Toggle Unit ({unit === "metric" ? "Fahrenheit" : "Celsius" })
        </button>
        </div>

        {weatherData &&
       
        <div className="onfo">
            <h1>{city}'s Weather </h1>
            <p>Temperature : 
            {unit === 'metric' ? Math.round(weatherData.main.temp-273.15) : Math.round((weatherData.main.temp-273.15)*9/5 +32) }&deg;
            {unit === 'metric' ? 'C' :'F'}</p>
            <p>Min_Temperature : {Math.round(weatherData.main.temp_min-273.15)}&deg;{unit === 'metric' ? 'C' :'F'}</p>
            <p>MAX_Temperature : {Math.round(weatherData.main.temp_max-273.15)}&deg;{unit === 'metric' ? 'C' :'F'}</p>
            <p>Humidity : {weatherData.main.humidity}%</p>
            <p>Wind Speed : {weatherData.wind.speed} m/s</p>
            <p>Wind Direction : {weatherData.wind.deg}&deg;</p>
            <p>Description : {weatherData.weather[0].description}</p>
            <img src={`https://openweathermap.org/img/w/${weatherData.weather[0].icon}.png`}
             alt= "Weather Icon"></img>
         </div>
        
         } 

         {forecastData && (
            <div>
                <h2> 5 Day Forecast</h2>
                <div>
                    {forecastData.map((forecast) =>(
                        <div key={forecast.dt}>
                            <p>Date : {new Date(forecast.dt *1000).toLocaleDateString()}</p>
                            <p> Average Temp :{Math.round(forecast.main.temp-273.15)}&deg;{unit === 'metric' ? 'C' : 'F'}</p>
                            <p>Description : {forecast.weather[0].description}</p>
            <img src={`http://openweathermap.org/img/w/${forecast.weather[0].icon}.png`}
             alt= "Weather Icon"></img>
                        </div>
                    ))}
                </div>
            </div>
         )}

        </>
        
    )
}

export default WeatherApp;
